import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom'


function App() {
  return (
    <Router>
      <Route exact path='/'>
        <LandingPage />
      </Route>

      <Route exact path='/home'>
      <Home />
      </Route>

    </Router>
  );
}

export default App;
